import React from "react";
import NavigationItem from "../NavigationItem/NavigationItem";
import GDGLogo from "../../assets/images/DSC-logo.png";
import "./Navigation.css";

//  Instantiate the NavigationItems here
const navigationItems = [
  {
    itemName: "Hello",
    itemColor: "White",
  },
];

class Navigation extends React.Component {
  renderNavigationItems = navigationItems.map((item) => {
    return (
      <NavigationItem itemName={item.itemName} itemColor={item.itemColor} />
    );
  });

  render() {
    return (
      <nav>
        <div className="navigation-bar">
          <div>
            <span>DLSU GDG</span>
            <img src={GDGLogo} alt="DSC-Logo" />
          </div>
          <div
            className="navigation-bar__navigation-items"
            style={{ display: "inline" }}
          >
            {this.renderNavigationItems}
          </div>
        </div>
      </nav>
    );
  }
}

export default Navigation;
